<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>labubu</title>
    <link rel="stylesheet" href="labubu.css">
    
</head>
<body>
   
    <div id="box">
        <div class="leftear">
            <div class="innerearone">
                <div class="deepinnerearone"></div>
            </div>
        </div>
        <div class="rightear">
            <div class="innereartwo">
                <div class="deepinnereartwo"></div>
        </div>
        </div>
        <div class="body">
            <div class="innerbody ">
                <div class="lefteyebrow"></div>
                <div class="righteyebrow"></div>
                <div class="leftinnercheek"></div>
                <div class="rightinnercheek"></div>
                <div class="lefteye">
                    <div class="innerlefteye"></div>
                    <div class="ballone"></div>
                </div>
                <div class="righteye">
                    <div class="innerrighteye"></div>
                    <div class="balltwo"></div>
                </div>
                <div class="nose"></div>
                <div class="lip"></div>
                <div class="teeth">
                    <div class="tooth1"></div>
                    <div class="tooth2"></div>
                    <div class="tooth3"></div>
                    <div class="tooth4"></div>
                    <div class="tooth5"></div>
                    <div class="tooth6"></div>
                    <div class="tooth7"></div>
                    <div class="tooth8"></div>
                    <div class="tooth9"></div>

                </div>
            </div>
        </div>

    </div>
   
    
    
</body>
</html>
